system.disableChatCommandDisplay("help")
system.disableChatCommandDisplay("cancel")
function eventChatCommand(n,m)
if m == "help" then
tfm.exec.chatMessage("Neste module, o shaman tem 2 minutos para construir um foguete que precisa levar todos os ratos para o espaço! Caso o shaman morra, a partida é encerrada.<br><br>Script e mapa criados por Fosfus7heads#0000. Conceito original de Nettoork#0000.<br>Versão 4.2.3",n)
end
if m == "cancel" then
if n == "Fosfus7heads#0000" or n == "Aurelianlua#0000" or n == "Forzaldenon#0000" then
	tfm.exec.setGameTime(5)
	tfm.exec.chatMessage("<R>Rodada cancelada! Iniciando uma nova rodada...")
end
end
end
function eventLoop(p,f)
if mode == "fly" then
loop=loop+1
end
if f < 1000 then
tfm.exec.newGame(map)
mode="building"
end
if p > 120000 then
if mode == "building" then
mode="fly"
end
for n,p in pairs(tfm.get.room.playerList) do
if p.y < 350 and f > 5000 then
tfm.exec.giveCheese(n)
tfm.exec.playerVictory(n)
mode="ending"
end
end
end
if p > 123000 then
if p < 123600 then
tfm.exec.chatMessage("<R>Tempo esgotado! Está na hora de voar!<br><ROSE><b>Atenção! Objetos voadores estão caindo do céu!</b>")
for n,p in pairs(tfm.get.room.playerList) do
tfm.exec.attachBalloon(n,false)
if tfm.get.room.playerList[n].isShaman then
tfm.exec.setShaman(n,false)
end
end
end
for i=1,2 do
tfm.exec.addShamanObject(objects[math.random(#objects)], math.random(-400,2000), 1, 0, 0, 0, false)
loop=0
end
end
end
function eventNewGame()
ui.setMapName("<N>RockerLaunch! <J>v4.2.3")
tfm.exec.setGameTime(338)
tfm.exec.chatMessage("<VP>O shaman tem 2 minutos para construir um foguete que precisa levar todos os ratos para o espaço!<br><br><BL>Em breve, RockerLaunch 5! Com novo mapa e mais objetos decorativos!")
mode="building"
for n,p in pairs(tfm.get.room.playerList) do
if tfm.get.room.playerList[n].isShaman then
tfm.exec.lowerSyncDelay(n)
shaman=n
end
end
end
function eventNewPlayer(n)
ui.setMapName("<N>RockerLaunch! <J>v4.2.3")
tfm.exec.chatMessage("<VP>Bem-vindos ao RockerLaunch 4! Neste module, o shaman tem 2 minutos para construir um foguete que precisa levar todos os ratos para o espaço! Digite !help para saber como jogar.<br><br><N>Script e mapa criados por Fosfus7heads#0000. Conceito original de Nettoork#0000.",n)
end
function eventPlayerWon(n)
tfm.exec.setGameTime(20)
end
function eventPlayerDied(n)
if tfm.get.room.playerList[n].isShaman or shaman == n then
tfm.exec.setGameTime(5)
tfm.exec.setPlayerScore(n,-1,false)
tfm.exec.chatMessage("<R>O shaman morreu! Iniciando uma nova rodada...")
tfm.exec.lowerSyncDelay(n)
end
local i=0
local n
for pname,player in pairs(tfm.get.room.playerList) do
	if not player.isDead and not player.isShaman then
		i=i+1
		n=pname
	end
end
if i==0 then
	tfm.exec.setGameTime(5)
elseif i==1 then
	tfm.exec.setGameTime(20)
end
end
tfm.exec.newGame(map)
